import React from 'react';
import './Input.css';


export default function Input({nameLabel, value,name, cb}){
    return(
        <div className='style-div'>
            <label className='style-label'>{nameLabel}</label>
            <input 
                    type='text' 
                    value={value} 
                    name={name} 
                    onChange={cb}
                    />
        </div>
    )
}
